import React from "react";
import "./AutoSwitch.css";
let state=0;



function Auto() {
    if (state==0) {
        <div class = "Auto" id=""> 
            <button class="button ">auto</button>
            <button class="button disabled">manual</button> 
        </div>
    }
    else{
    <div class = "Auto" id=""> 
        <button class="button disabled">auto</button>
        <button class="button ">manual</button> 
    </div>
    }
}


export default Auto;
